import styled from "styled-components";

export const Title = styled.h1`
    text-align: center;
    color: var(--txt-color);
    font-size: 30px;
`;

export const Tabs = styled.div`
    display: flex;
`;
export const TabsButton = styled.div`
    display: flex;
    flex-direction: row;
    justify-content: center;
    flex-wrap: wrap;

    button{
        background: var(--btn-color);
        border: none;
    }
`;

